import React from "react";
import { Image, Text, View, StyleSheet, TextInput, Button } from "react-native";
import colors from "../helpers/colors";
import CircularLogoHeader from "./presentationals/CircularLogoHeader";

function LoginView(props) {
  return <View style={styles.loginStyle}></View>;
}

const styles = StyleSheet.create({
  loginStyle: {
    alignItems: "center",
    justifyContent: "center",
  },
  loginInputContainer: {
    // transform: [{ translateY: -130 }],
  },
  loginInputLabel: {
    color: colors.green100,
  },
  loginInputFields: {
    backgroundColor: colors.greenlogin,
    borderColor: colors.greenlogin,
    borderWidth: 2,
    borderRadius: 5,
    height: 30,
    width: 250,
  },
  loginButton: {
    marginTop: 20,
    borderRadius: 5,
    overflow: "hidden",
  },
});

export default LoginView;
